import React from "react";
import "./Home.css";
import bannerImage from "./images/banner-1.jpg";

function Home() {
	return (
		<div className="home">
			<div className="home__container">
				<img className="home__image" src={bannerImage} alt="banner-image" />
			</div>
		</div>
	);
}

export default Home;
